import React from "react";
import Slider from "react-slick";
// import "./index.css";
function Home() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      {randimg.map((item, index) => (
        <div key={index}>
          <img src={item.img} alt={item.alt}></img>
        </div>
      ))}
    </Slider>
  );
}

export default Home;
